import './Input.css';

const Input = () => {
    return (
        <div className='input'>
            <div className='title'>
                <div>
                    Title
                </div>
                <div>
                <input className='titleInputBox'/>
                </div>
                <div>
                    
                </div>
            </div>
            <div className='content'>
                <div>
                    Content
                </div>
                <div>
                <textarea className='contentInputBox'/>
                </div>
            </div>
        </div>
    );
};


export default Input;
